import React from 'react'
import Card from './Card'

const Home = ({ data }) => {

    if (data) {
        return (
            <main>
                {data.map((card) => {
                    return <Card card={card} />
                })}
            </main>
        )
    } else

        return (
            <main>
                <h1>hard <code></code></h1>
            </main>
        )
}

export default Home
